// src/components/layout/SidebarMenu/SidebarMenu.js
import React from 'react';
import { useNavigate } from 'react-router-dom'
import ButtonSideBar from '../../ui/buttons/ButtonSideBar';
import './SidebarMenu.css';

function SidebarMenu() {
  const navigate = useNavigate();
  return (
    <div className="sidebar">
      <ul>
        <li><button className="button-25" onClick={() => navigate("/home")}>Accueil</button></li>
        <li><button className="button-25" onClick={() => navigate("/equipments")}>Ã‰quipements</button></li>
        <li><button className="button-25" onClick={() => navigate("/tickets")}>Tickets</button></li>
        <li><ButtonSideBar onClick={() => navigate("/home")}>Accueil</ButtonSideBar></li>
      </ul>
    </div>
  );
}

export default SidebarMenu;
